import '../App.css';
import React from 'react';

function Jambo() {
    return (
        <div>
            <section className="pt-5">
                <div className="jumbotron jumbotron-fluid">
                    <div className="container">
                        <h1 className="text-center">FREE SHIPPING</h1>
                        <p className="lead text-center"><b>*ON ALL INTERNATIONAL ORDER ABOVE PKR 60,000/-</b></p>
                    </div>
                </div>

            </section>
        </div>
    );
}

export default Jambo;
